CREATE TRIGGER `validate_foreign_id_before_insert` BEFORE INSERT ON `prices` FOR EACH ROW BEGIN
    -- Check if the foreign_id is a valid stock_no in the inventory table
    IF NOT EXISTS (
        SELECT 1
        FROM inventory
        WHERE stock_no = NEW.foreign_id
    ) THEN
        -- Check if the foreign_id is a valid id in the facilities table
        IF NOT EXISTS (
            SELECT 1
            FROM facilities
            WHERE id = NEW.foreign_id
        ) THEN
            -- If neither exists, signal an error
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Invalid foreign_id: does not match any stock_no in inventory or id in facilities.';
        END IF;
    END IF;
END
$$
DELIMITER ;

